import React from "react";
const PRODUCTS=[
    {id:"p1",title:"Product 1"},
    {id:"p2",title:"Product 2"},
    {id:"p3",title:"Product 3"}
]
export default function ProductsPage(){
    return <>
        <h1>the Products </h1>
        <ul>
            <li>Product 1</li>
            <li>Product 2</li>
            <li>Product 3</li>
        </ul>
    </>
}
